import { useContext } from "react";
import { AuthContext } from "../contexts/AuthContext";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const { userData, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  if (!userData) {
    return <p>Cargando...</p>;
  }

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="container mt-5">
      <h2>Bienvenido, {userData.email}</h2>
      <p>Tu rol es: <strong>{userData.rol}</strong></p>

      {userData.rol === "admin" ? (
        <div className="alert alert-info mt-4">
          <h4>Zona de administrador</h4>
          <ul>
            <li>Subida de nuevos vídeos</li>
            <li>Gestión de usuarios</li>
            <li>Panel de estadísticas</li>
          </ul>
        </div>
      ) : (
        <div className="alert alert-success mt-4">
          <h4>Zona de usuario</h4>
          <ul>
            <li>Recomendaciones de baile</li>
            <li>Mis vídeos favoritos</li>
            <li>Formulario de preferencias</li>
          </ul>
        </div>
      )}

      <button className="btn btn-danger mt-4" onClick={handleLogout}>
        Cerrar sesión
      </button>
    </div>
  );
};

export default Dashboard;
